"""At this point I wan to study teh effect of balancing the dataset:


**Balanicng the dataset**

* Undersampling  An effort to eliminate data point from the majority class randomly until the classes are balanced. There is a likelihood of information loss which might lead to poor model training.

* Oversampling  This is the process to replicate minority class instances randomly. This approach can overfit and lead to inaccurate predictions on test data.

* SMOTE  SMOTE generates synthetic samples by taking each minority class sample and introducing synthetic examples along the line segments joining any/all of the k minority class nearest neighbors as shown in below GIF. More importantly, this approach effectively forces the decision region of the minority class to become more general. Check this article for an easy explanation. Unfortunately, this technique doesnt work well with text data because the numerical vectors that are created from the text are very high dimensional.
"""

